  false,\n\t\"url\": null,\n\t\"notes\": \"The Geographic Names Information System
  (GNIS) actively seeks data from andnttttpartnerships with Government agencies at
  all levels and other interestednttttorganizations. The GNIS is the Federal standard
  for geographic nomenclature. ThenttttU.S. Geological Survey developed the GNIS for
  the U.S. Board on Geographic Names, anttttFederal inter-agency body chartered by
  public law to maintain uniform feature namenttttusage throughout the Government
  and to promulgate standard names to the public. ThenttttGNIS is the official repository
  of domestic geographic names data; the officialnttttvehicle for geographic names
  use by all departments of the Federal Government; andnttttthe source for applying
  geographic names to Federal electronic and printed productsnttttof all types. See
  http://geonames.usgs.gov for additional information.\",\n\t\"license_title\": null,\n\t\"extras\":
